// Dashboard_new.jsx
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import Navbar from '../../components/Layout/Navbar';
import { AdminDashboardService, initializeSampleData } from '../../services/adminDashboardService';

const AdminDashboard = () => {
  const { user } = useAuth();
  const [dashboardData, setDashboardData] = useState({
    stats: [],
    activities: []
  });
  const [loading, setLoading] = useState(true);
  
  useEffect(() => {
    // ÂàùÂßãÂåñÁ§∫‰æãÊï∞ÊçÆÔºàÂ¶ÇÊûúÈúÄË¶ÅÔºâ
    initializeSampleData();
    
    // Âä†ËΩΩ‰ª™Ë°®ÊùøÊï∞ÊçÆ
    const loadDashboardData = () => {
      try {
        const data = AdminDashboardService.getDashboardData();
        setDashboardData(data);
      } catch (error) {
        console.error('Âä†ËΩΩ‰ª™Ë°®ÊùøÊï∞ÊçÆÂ§±Ë¥•:', error);
        // ‰ΩøÁî®ÈªòËÆ§Êï∞ÊçÆ‰Ωú‰∏∫ÂêéÂ§á
        setDashboardData({
          stats: [
            { title: 'ÊÄªÁî®Êà∑Êï∞', value: '0', change: '+0', trend: 'neutral', icon: 'üë•', color: 'primary' },
            { title: 'Ê¥ªË∑ÉËØ∑Ê±Ç', value: '0', change: '+0', trend: 'neutral', icon: 'üìã', color: 'secondary' },
            { title: '‰ªäÊó•ÂåπÈÖç', value: '0', change: '+0', trend: 'neutral', icon: '‚úÖ', color: 'success' },
            { title: 'ÂæÖÂÆ°Ê†∏', value: '0', change: '+0', trend: 'neutral', icon: '‚è≥', color: 'warning' }
          ],
          activities: []
        });
      } finally {
        setLoading(false);
      }
    };
    
    loadDashboardData();
    
    // ÂèØÈÄâÔºöËÆæÁΩÆÂÆöÊó∂Âà∑Êñ∞
    const interval = setInterval(loadDashboardData, 30000); // ÊØè30ÁßíÂà∑Êñ∞‰∏ÄÊ¨°
    
    return () => clearInterval(interval);
  }, []);

  const quickActions = [
    { title: 'Áî®Êà∑ÁÆ°ÁêÜ', icon: 'üë•', path: '/admin/users', color: 'blue' },
    { title: 'ÊúçÂä°Á±ªÂà´', icon: 'üìÅ', path: '/admin/categories', color: 'green' },
    { title: 'Êï∞ÊçÆÊä•Âëä', icon: 'üìä', path: '/admin/reports', color: 'purple' },
    { title: 'Á≥ªÁªüËÆæÁΩÆ', icon: '‚öôÔ∏è', path: '/admin/settings', color: 'gray' }
  ];

  return (
    <div className="page-container">
      <Navbar userType="admin" user={user} />
      <div className="main-content">
        <div className="dashboard">
          <div className="dashboard-header">
            <div className="header-content">
              <h1 className="dashboard-title">ÁÆ°ÁêÜÂëò‰ª™Ë°®Êùø</h1>
              <p className="dashboard-subtitle">Ê¨¢ËøéÂõûÊù•Ôºå{user?.name}ÔºÅËøôÈáåÊòØÁ≥ªÁªüÊ¶ÇËßà</p>
            </div>
            <div className="header-actions">
              <button className="btn btn-primary">
                <span className="btn-icon">üìä</span>
                ÁîüÊàêÊä•Âëä
              </button>
            </div>
          </div>

          <div className="stats-grid">
            {stats.map((stat, index) => (
              <div key={index} className={`stat-card ${stat.color}`}>
                <div className="stat-header">
                  <div className="stat-info">
                    <div className="stat-title">{stat.title}</div>
                    <div className="stat-value">{stat.value}</div>
                  </div>
                  <div className={`stat-icon ${stat.color}`}>
                    {stat.icon}
                  </div>
                </div>
                <div className={`stat-change ${stat.trend}`}>
                  {stat.trend === 'up' ? '‚Üó' : stat.trend === 'down' ? '‚Üò' : '‚Üí'} 
                  {stat.change} Êú¨Êúà
                </div>
              </div>
            ))}
          </div>

          <div className="content-grid">
            <div className="card">
              <div className="card-header">
                <h3 className="card-title">Âø´ÈÄüÊìç‰Ωú</h3>
              </div>
              <div className="card-body">
                <div className="actions-grid">
                  {quickActions.map((action, index) => (
                    <Link key={index} to={action.path} className="action-card">
                      <div className={`action-icon ${action.color}`}>
                        {action.icon}
                      </div>
                      <div className="action-title">{action.title}</div>
                    </Link>
                  ))}
                </div>
              </div>
            </div>

            <div className="card">
              <div className="card-header">
                <h3 className="card-title">ÊúÄËøëÊ¥ªÂä®</h3>
              </div>
              <div className="card-body">
                <div className="activity-list">
                  <div className="activity-item">
                    <div className="activity-icon">üë§</div>
                    <div className="activity-content">
                      <p>Êñ∞Áî®Êà∑Ê≥®ÂÜå - Âº†ÂÖàÁîü</p>
                      <span className="activity-time">2ÂàÜÈíüÂâç</span>
                    </div>
                  </div>
                  <div className="activity-item">
                    <div className="activity-icon">‚úÖ</div>
                    <div className="activity-content">
                      <p>ÂåªÁñóÈô™ÂêåËØ∑Ê±ÇÂ∑≤ÂåπÈÖç</p>
                      <span className="activity-time">1Â∞èÊó∂Ââç</span>
                    </div>
                  </div>
                  <div className="activity-item">
                    <div className="activity-icon">üìã</div>
                    <div className="activity-content">
                      <p>Êñ∞ÊúçÂä°ËØ∑Ê±Ç - Ë¥≠Áâ©ÂçèÂä©</p>
                      <span className="activity-time">3Â∞èÊó∂Ââç</span>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
